import React from "react";
import "bootstrap/dist/css/bootstrap.css";

function App() {
  return (
    <div className="container p-5">
      <div className="row">
        <div col-md-6>Question</div>
        <div>Answer</div>
      </div>
    </div>
  );
}
export default App;
